  false,\n\t\"url\": null,\n\t\"notes\": \"After extreme weather events, the Bureau
  of Forestry Tree Emergency is deployed to remove plant debris blocking or cluttering
  the public way. This metric tracks the average number of days the Department of
  Streets and Sanitation (DSS) takes to complete tree debris removal requests per
  week. Median days to complete requests as well as total number of requests fulfilled
  per week are also available by mousing over columns. The Department of Streets &
  Sanitation responds to emergency tree debris removal requests logged by 311u2019s
  Customer Service Requests (CSR) system. The target response time for Tree Debris
  Removal is 1 day. For more information on open tree debris removal requests, see
  https://data.cityofchicago.org/d/mab8-y9h3\",\n\t\"license_title\": \"License Not
